css:
.text-info code {
  color: #1492ff;
  background: rgba(31, 150, 255, 0.2);
}
.text-info a,
.text-info a code {
  text-decoration: underline;
  color: #0078e0;
}
.text-info a:hover,
.text-info a code:hover {
  color: #006ac7;
}
.text-success code {
  color: #2db448;
  background: rgba(64, 181, 87, 0.2);
}
.text-success a,
.text-success a code {
  text-decoration: underline;
  color: #238b37;
}
.text-success a:hover,
.text-success a code:hover {
  color: #1e762f;
}
.text-warning code {
  color: #d5880b;
  background: rgba(206, 157, 59, 0.2);
}
.text-warning a,
.text-warning a code {
  text-decoration: underline;
  color: #a56909;
}
.text-warning a:hover,
.text-warning a code:hover {
  color: #8d5907;
}
.text-error code {
  color: #f42a2a;
  background: rgba(210, 75, 75, 0.2);
}
.text-error a,
.text-error a code {
  text-decoration: underline;
  color: #df0c0c;
}
.text-error a:hover,
.text-error a code:hover {
  color: #c70a0a;
}
